// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract GasReserve {
    address public admin;
    mapping(address => bool) public authorizedContracts;
    
    constructor() {
        admin = msg.sender; // Deployer is admin
    }

    // ðŸ“Œ Fund the gas reserve with ETH
    function deposit() external payable {
        require(msg.value > 0, "Must send ETH");
    }

    // ðŸ“Œ Whitelist Vault & Strategy contracts to use gas
    function authorizeContract(address _contract) external {
        require(msg.sender == admin, "Only admin");
        authorizedContracts[_contract] = true;
    }

    // ðŸ“Œ Remove authorization (in case of upgrades)
    function deauthorizeContract(address _contract) external {
        require(msg.sender == admin, "Only admin");
        authorizedContracts[_contract] = false;
    }

    // ðŸ“Œ Allow whitelisted contracts to request ETH for gas fees
    function requestGas(uint256 _amount) external {
        require(authorizedContracts[msg.sender], "Not authorized");
        require(address(this).balance >= _amount, "Not enough gas reserve");

        payable(msg.sender).transfer(_amount);
    }

    // ðŸ“Œ Emergency withdraw (Admin only)
    function emergencyWithdraw(uint256 _amount) external {
        require(msg.sender == admin, "Only admin");
        payable(admin).transfer(_amount);
    }
}

